class AppComponent {
    constructor(itemService) {
        this.itemService = itemService;
    }
    ngOnInit() {
        this.getItems();
    }
    getItems() {
        this.itemService.getItems().subscribe((response) => {
            this.items = response;
        }, (error) => {
            alert(error.message);
        });
    }
    onAddItem(addForm) {
        document.getElementById('add-Item-form').click();
        this.itemService.addItem(addForm.value).subscribe((response) => {
            console.log(response);
            this.getItems();
            addForm.reset();
        }, (error) => {
            alert(error.message);
        });
    }
    onUpdateItem(item) {
        this.itemService.updateItem(item).subscribe((response) => {
            console.log(response);
            this.getItems();
        }, (error) => {
            alert(error.message);
        });
    }
    onDeleteItem(itemId) {
        this.itemService.deleteItem(itemId).subscribe((response) => {
            console.log(response);
            this.getItems();
        }, (error) => {
            alert(error.message);
        });
    }
    onOpenModal(item, mode) {
        const container = document.getElementById('main-container');
        const button = document.createElement('button');
        button.type = 'button';
        button.style.display = 'none';
        button.setAttribute('data-toggle', 'modal');
        if (mode === 'add') {
            button.setAttribute('data-target', '#addItemModal');
        }
        if (mode === 'edit') {
            button.setAttribute('data-target', '#updateItemModal');
            this.editItem = item;
        }
        if (mode === 'delete') {
            button.setAttribute('data-target', '#deleteItemModal');
            this.deleteItem = item;
        }
        container.appendChild(button);
        button.click();
    }
}
